        this.ws.send(JSON.stringify({
          sub: "CoinTeamCount",
          coinTeam: "XBIT-USDT"
        }));
        this.ws.send(JSON.stringify({
          sub: "Depth",
          coinTeam: "XBIT-USDT"
        }));
        this.ws.send(JSON.stringify({
          sub: "Trade",
          coinTeam: "XBIT-USDT"
        }));

